import React from "react";
import { ReactDOM } from "react-dom";

function Count() {
    const Time = () =>{
        return <h1> {new Date().toLocaleTimeString()}</h1>;
    }

    ReactDOM.render(
        Time, document.getElementById('root')
    );
}
setInterval(Count, 1000);

export default Count;
